import React, { useEffect, useState } from "react";
import { helpHttp } from "../helpers/helpHttp";

const NewLeaderBoard = () => {
  let { user } = useContext(AuthContext);
  const [userData, setUserData] = useState();
  const [tops, setTops] = useState([]);
  const getTop = () => {
    helpHttp()
      .get(`${mySite}topusers/`)
      .then((res) => {
        setTops(res.topuser);
      });
    helpHttp()
      .get(`${mySite}users/${user.user_id}`)
      .then((res) => {
        setUserData(res.user);
        console.log(res);
        console.log(res.user.score);
      });
  };
  useEffect(() => {
    getTop();
  }, []);

  return (
    <div className="text-black ">
      <table class="w-full text-left bg-white shadow-lg rounded-lg">
        <thead>
          <tr class="bg-gray-800 text-white">
            <th class="px-4 py-2 text-sm font-bold uppercase tracking-wide">
              Rank
            </th>
            <th class="px-4 py-2 text-sm font-bold uppercase tracking-wide">
              Name
            </th>
            <th class="px-4 py-2 text-sm font-bold uppercase tracking-wide">
              Score
            </th>
          </tr>
        </thead>
        <tbody>
          <tr class="bg-gray-100">
            <td class="border px-4 py-2 text-sm">1</td>
            <td class="border px-4 py-2 text-sm">{tops[0].username}</td>
            <td class="border px-4 py-2 text-sm">100</td>
          </tr>
          <tr class="bg-gray-200">
            <td class="border px-4 py-2 text-sm">2</td>
            <td class="border px-4 py-2 text-sm">Jane Doe</td>
            <td class="border px-4 py-2 text-sm">90</td>
          </tr>
          <tr class="bg-gray-100">
            <td class="border px-4 py-2 text-sm">3</td>
            <td class="border px-4 py-2 text-sm">Bob Smith</td>
            <td class="border px-4 py-2 text-sm">80</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
};

export default NewLeaderBoard;
